const CourseList = ({ courses }) => {
  const snippet = (props) => {
    return props.courses.Зорилго.substring(0, 200) + '...';
  };
  return (
    <div className='mt-10'>
      {courses.map((course) => (
        <div
          className='p-2.5 mt-5 mx-10 border border-gray-500 rounded-xl
            hover:cursor-pointer hover:shadow-lg'
          key={course.Хичээлийн_дугаар}
        >
          <h2 className='text-xl font-bold mb-3'>{course.Монгол_нэр}</h2>
          <p>{courses.Зорилго.substring(0, 200) + '...'}</p>
        </div>
      ))}
    </div>
  );
};

export default CourseList;
